import React, { useState } from "react";
import './App.css';
import './index.css';

function NavBar() {
  return (
    <nav>
      <button className="Check" onClick={() => alert('Add Task functionality not implemented yet!')}>Add Task</button>
    </nav>
  );
}

function App() {
  const [tasks, setTasks] = useState([]);

  const addTask = (taskDescription) => {
    setTasks([...tasks, { description: taskDescription }]);
  };

  return (
    <div className="App">
      <div>Tasks</div>
      <NavBar />
      <div className="container">
        {tasks.map((task, index) => (
          <div className="Tasks" key={index}>
            <button className="Check"></button>
            <span>{task.description}</span>
          </div>
        ))}







      </div>
    </div>
  );
}

export default App;
